import React from 'react';
import { Jumbotron, Button } from 'reactstrap';

const JumbotronHeaderLandingPage = (props : any) => {
  return (
    <div>
      <Jumbotron className="">
        <h1 className="display-3">React Store</h1>
        <p className="lead">Хранилище(да-да-да) React компонентов, утилит и других обьектов для многоразового переиспользования.</p>
        <hr className="my-2" />
        <p>It uses utility classes for typography and spacing to space content out within the larger container.</p>
        <p className="lead">
            <Button outline color="secondary">React Site</Button>{' '}
        </p>
      </Jumbotron>
    </div>
  );
};

export default JumbotronHeaderLandingPage;
